import React from 'react'
import '../Home.css';

import 'bootstrap/dist/css/bootstrap.min.css';


import BolhaQsomos from "../images/BolhaQsomos.png";
import RectangleAzul from "../images/RectangleAzul.png";
import RectangleAzulBottom from "../images/RectangleAzulBottom.png";



function QuemSomosImg(){
    return (
    
      <section>        
      <div class="" >
        
             <img
                style={{position:"absolute", zIndex:"-2" }}
                src={RectangleAzul}
                class="img-fluid"
                alt="">       
              </img> 
              <img  src={RectangleAzulBottom} 
              class="img-fluid"  
              alt="FundoGoTokens"
              style={{ position:"absolute", zIndex:"-1", marginTop:'190px'}}
              />  
              <img  src={BolhaQsomos} 
              class="img-fluid"  
              alt="FundoGoTokens"
              style={{ position:"absolute", zIndex:"-1"}}
              />        
      </div>
  </section>
        
    );
}

export default QuemSomosImg;
